import React from 'react'

function FaceRecognition( props ) {
  return (
    <div className='center butthole'>
      <div className='absolute mt2'>
        <img src={props.imageUrl.value} alt='' width='500px' height='auto' />
      </div>
    </div>
  )
}


export default FaceRecognition
